  @Test
  public void testDragonBookP262() {
    String ebnf =
          "S: C, C.\n"
        + "C: 'c', -C;\n"
        + "   'd'.";
    Grammar grammar = parse(ebnf);
    Grammar bnf = BNF.process(grammar);
    Parser parser = Generator.generate(bnf);
    String result = parser.parse("cccccdccd");
    String expectedResult = "<S><C>cccccd</C><C>ccd</C></S>";
    assertEquals(expectedResult, result);
  }

  @Test
  public void testMultiwayFork() {
    String ebnf =
          "S: -T*.\n"
        + "T: A, 'x', 'a'; B, 'x', 'b'; C, 'x', 'c'; D, 'x', 'd'.\n"
        + "A: .\n"
        + "B: .\n"
        + "C: .\n"
        + "D: .";
    Grammar grammar = parse(ebnf);
    Grammar bnf = BNF.process(grammar);
    Parser parser = Generator.generate(bnf);
    String result = parser.parse("xaxbxcxd");
    assertEquals("<S><A/>xa<B/>xb<C/>xc<D/>xd</S>", result);
  }

  private static class PropertiesChecker extends Visitor {
    public RangeSet allChars = RangeSet.builder().build();

    public static void process(Grammar g) {
      new PropertiesChecker().visit(g);
    }

    @Override
    public void visit(Rule r) {
      if (r == r.getGrammar().getRules().values().iterator().next()) {
        assertEquals(Mark.DELETE, r.getMark());
        assertEquals(r.getGrammar().getAdditionalNames().get(Term.START)[0], r.getName());
      }
      else {
        assertEquals(Mark.NONE, r.getMark());
      }
      super.visit(r);
    }

    @Override
    public void visit(Alt a) {
      super.visit(a);
      for (Term term : a.getTerms()) {
        if (term instanceof Alts) {
          Alts alts = (Alts) term;
          assertFalse(alts.getAlts().size() == 1 && alts.getAlts().get(0) instanceof Alt);
        }
      }
    }

    @Override
    public void visit(Alts a) {
      super.visit(a);
      assertTrue(a.getParent() instanceof Rule);
      for (Alt alt : a.getAlts()) {
        assertFalse(alt.getTerms().size() == 1 && alt.getTerms().get(0) instanceof Alts);
      }
    }

    @Override
    public void visit(Nonterminal n) {
      assertNotEquals(Mark.NONE, n.getMark());
      super.visit(n);
    }

    @Override
    public void visit(Insertion i) {
      super.visit(i);
      Alt alt = (Alt) i.getParent();
      List<Term> terms = alt.getTerms();
      assertEquals(terms.get(terms.size() - 1), i, "insertion not at end of alternative");
    }

    @Override
    public void visit(Charset c) {
      super.visit(c);
      check(c.getRangeSet());
    }

    @Override
    public void visit(Literal l) {
      fail();
    }

    @Override
    public void visit(Control c) {
      fail();
    }

    private void check(RangeSet rangeSet) {
      int charCountWithout = allChars.charCount();
      RangeSet union = allChars.union(rangeSet);
      int charCountWith = union.charCount();

      if (charCountWithout != charCountWith)
        assertEquals(charCountWithout + rangeSet.charCount(), charCountWith);

      allChars = union;
    }
  }
